ownerLogin":"gokul-chandrasekar","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2023-07-10T21:59:21.000+05:30","ownerAvatar":"https://avatars.githubusercontent.com/u/113445140?v=4","public":true,"private":false,"isOrgOwned":false},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"main","listCacheKey":"v0:1691938061.0","canEdit":true,"refType":"branch","currentOid":"8903211aceb994e588d3984da88f6a675bda04fb"},"path":"R lab programs/Ex 29. IRIS dataset.R","currentUser":{"id":100275995,"login":"sakthivelg007","userEmail":"svel56937@gmail.com"},"blob":{"rawLines":["# Load the Iris dataset\r","data(\"iris\")\r","\r","# (i) Dimension, Structure, Summary statistics, Standard Deviation of all features\r","cat(\"Dimensions of the dataset:\", dim(iris), \"\\n\\n\")\r","str(iris)\r","summary(iris)\r","cat(\"\\nStandard Deviation of all features:\\n\")\r","sapply(iris[, 1:4], sd)\r","\r","# (ii) Mean and Standard Deviation of features grouped by species\r","species_grouped <- aggregate(. ~ Species, data = iris, FUN = function(x) c(mean(x), sd(x)))\r","colnames(species_grouped)[2:9] <- c(\"Mean_Sepal.Length\", \"Mean_Sepal.Width\", \"Mean_Petal.Length\", \"Mean_Petal.Width\",\r","                                    \"SD_Sepal.Length\", \"SD_Sepal.Width\", \"SD_Petal.Length\", \"SD_Petal.Width\")\r","print(species_grouped)\r","\r","# (iii) Quantile value of sepal width and length\r","cat(\"\\nQuantiles of Sepal Width:\", quantile(iris$Sepal.Width), \"\\n\")\r","cat(\"Quantiles of Sepal Length:\", quantile(iris$Sepal.Length), \"\\n\")\r","\r","# (iv) Create new data frame iris1 with Sepal.Length.Cate\r","iris1 <- iris\r","iris1$Sepal.Length.Cate <- cut(iris$Sepal.Length, breaks = quantile(iris$Sepal.Length), labels = FALSE)\r","\r","# (v) Average value of numerical variables by Species and Sepal.Length.Cate\r","avg_values <- aggregate(. ~ Species + Sepal.Length.Cate, data = iris1, FUN = mean)\r","print(avg_values)\r","\r","# (vi) Average mean value of numerical variables by Species and Sepal.Length.Cate\r","avg_mean_values <- aggregate(. ~ Species + Sepal.Length.Cate, data = iris1, FUN = function(x) mean(mean(x)))\r","print(avg_mean_values)\r","\r","# (vii) Create Pivot Table based on Species and Sepal.Length.Cate\r","pivot_table <- reshape2::dcast(avg_values, Species ~ Sepal.Length.Cate, value.var = c(\"Sepal.Length\", \"Sepal.Width\", \"Petal.Length\", \"Petal.Width\"))\r","print(pivot_table)\r"],"stylingDirectives":[[{"start":0,"end":23,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":5,"end":11,"cssClass":"pl-s"},{"start":5,"end":6,"cssClass":"pl-pds"},{"start":10,"end":11,"cssClass":"pl-pds"}],[],[{"start":0,"end":82,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":4,"end":32,"cssClass":"pl-s"},{"start":4,"end":5,"cssClass":"pl-pds"},{"start":31,"end":32,"cssClass":"pl-pds"},{"start":38,"end":42,"cssClass":"pl-smi"},{"start":45,"end":51,"cssClass":"pl-s"},{"start":45,"end":46,"cssClass":"pl-pds"},{"start":46,"end":50,"cssClass":"pl-cce"},{"start":50,"end":51,"cssClass":"pl-pds"}],[{"start":4,"end":8,"cssClass":"pl-smi"}],[{"start":8,"end":12,"cssClass":"pl-smi"}],[{"start":4,"end":45,"cssClass":"pl-s"},{"start":4,"end":5,"cssClass":"pl-pds"},{"start":5,"end":7,"cssClass":"pl-cce"},{"start":42,"end":44,"cssClass":"pl-cce"},{"start":44,"end":45,"cssClass":"pl-pds"}],[{"start":7,"end":11,"cssClass":"pl-smi"},{"start":14,"end":15,"cssClass":"pl-c1"},{"start":15,"end":16,"cssClass":"pl-k"},{"start":16,"end":17,"cssClass":"pl-c1"},{"start":20,"end":22,"cssClass":"pl-smi"}],[],[{"start":0,"end":65,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":15,"cssClass":"pl-smi"},{"start":16,"end":18,"cssClass":"pl-k"},{"start":29,"end":30,"cssClass":"pl-smi"},{"start":31,"end":32,"cssClass":"pl-k"},{"start":33,"end":40,"cssClass":"pl-smi"},{"start":42,"end":46,"cssClass":"pl-v"},{"start":47,"end":48,"cssClass":"pl-k"},{"start":49,"end":53,"cssClass":"pl-